 },
 ["Дух древнего коня"]={
  ["Купите лошадиный корм для Духа древнего коня у Меридет Карлсон в Южнобережье.\n\nУбейте Тендриса Криводрева в башне Забытого Города в Фераласе и освободите духа. Накормите духа кормом и получите благословление для арканитового чепрака."]={5,11025789},
