 },
 ["Рога ящера"]={
  ["Соберите 5 невредимых рогов ящера с яркочешуйчатых смертехватов и отнесите их Мебоку Миззриксу в Кабестан."]={0,2813990592},
 },
 ["Битва за Хилсбрад"]={
  ["Убейте 6 хилсбрадских батраков, 6 хилсбрадских фермеров, фермеров Рея и Гетца и возвращайтесь к Дарталии на мельницу Таррен."]={178,1062068898},
  ["Убейте 15 хилсбрадских крестьян и вернитесь к Дарталии на мельницу Таррен."]={178,3154992778},
  ["Убейте кузнеца Верринтана и 4 хилсбрадских учеников кузнеца.\n\nПринести партию железа Дарталии на мельницу Таррен."]={178,1269184218},
  ["Убейте мирового судью Бернсайда, и 4 членов совета Хилсбрада. Уничтожьте Хилсбрадское официальное объявление. Украдите регистрационную книгу Хилсбрада. Возвращайтесь к Дарталии на мельницу Таррен."]={178,1215733186},
  ["Убейте штейгера Бондса и 10 хилсбрадских шахтеров и доложите о проделанной работе Дарталии на мельнице Таррен."]={178,2261623074},
  ["Отправляйтесь в Дун Гарок и убейте 8 горных пехотинцев, 4 стрелков, 2 жрецов и капитана Железную Гору. После возвращайтесь к Дарталии на мельницу Таррен."]={178,405676786},
  ["Отнесите запечатанное рекомендательное письмо Дарталии Вариматасу в Подгород."]={0,830836160},
 },
 ["Угроза из Глубин"]={
  ["Поговорите с Дже'неу Санкри в Ясеневом лесу."]={178,2044731818},
 },
 ["Башни и бункеры"]={
  ["Захватите башню врага и возвращайтесь к капралу Тике Кровавому Рыку в Альтеракские горы."]={178,911585562},
  ["Уничтожьте вымпел на вражеской башне или бункере и возвращайтесь к сержанту Даргену Грозовой Вершине в Альтеракские горы."]={77,1104017669},
 },
 ["Лярд потерял свой обед"]={
  ["Найдите обед Лярда из деревни Сломанного Клыка во Внутренних землях.\n\nЛярд сказал, что потерял свой обед на острове к северу, где могут встретиться тролли из племени Порочной Ветви."]={178,2759979762},
 },
 ["Дрожь земли"]={
  ["С помощью знака земли активируйте алмазный, опаловый и аметистовый столпы и извлеките рунные камни. $b$bПоместите рунные камни на печать земли и освободите драконов Чернохлыста и Гематуса. $b$bУбейте драконов и принесите Гареку наручники Чернохлыста, цепи Гематуса и знак земли."]={77,1573277861},
  ["Принесите знак земли Гареку."]={77,986949149},
 },
