 },
 ["Найти КПХ-9/HL!"]={
  ["Отнесите аварийный маяк к автономному роботу Карлса. Робот находится во Внутренних землях, в устье реки близ Осклизлой скалы."]={0,2790670472},
 },
 ["Яйцо чащобного паука"]={
  ["Принесите яйцо чащобного тенетника Гилшалану, стоящему у Альдрассила."]={0,2950192384},
 },
 ["Отекшие пальцы"]={
  ["По поручению Хансела Большерука убейте 20 тяжелых боевых големов, которых можно найти в землях, окружающих Котлован в Тлеющем ущелье. По выполнении задания вернитесь к Ханселу."]={0,2966617944},
 },
 ["Мальчик-кроколиск и бородатый мурлок"]={
  [""]={0,2970466056},
 },
 ["Посылка в Штормград"]={
  ["Доставьте посылку Вильяма Моргану Песту в Торговый квартал Штормграда."]={77,2334950117},
 },
 ["Серебряный Оплот"]={
  ["Откройте Серебряный Оплот и получите награду."]={0,3187559352},
 },
 ["Испытательные земли"]={
  ["Отправляйтесь в пещеру Дикой Лапы, расположенную на юго-востоке от основной базы в Альтеракской долине, и добудьте знамя Северного Волка. Отнесите знамя Северного Волка воеводе Лаггронду."]={0,839408744},
  ["Отправляйтесь в пещеру Ледяного Крыла, которая расположена в Альтеракской долине, на юго-западе от Дун Болдара, и добудьте знамя Грозовой Вершины. Отдайте знамя лейтенанту Мурпу в Альтеракских горах."]={0,2862657320},
 },
 ["Рога сатира"]={
  ["Добудьте 16 рогов сатира для Пиксель на заставе Расщепленного Дерева."]={178,3260470066},
 },
 ["Древний лист"]={
  ["Find the owner of the Ancient Petrified Leaf. Good luck, <name>; It's a big world."]={0,1592412096},
 },
 ["В бездне безумия"]={
  ["Commander Mar'alith at Cenarion Hold in Silithus wants you to find his beloved Natalia. The information that you gathered points to Hive'Regal in the south as being the area in which you may find Mistress Natalia Mar'alith.\n\nDo not forget to visit the dwarves at Bronzebeard's camp before venturing into the hive. They might have some additional work and advice for you.\n\nAnd <name>, remember the Commander's words: \"Do what you must...\""]={0,3982357880},
 },
 ["Порядок должен быть восстановлен"]={
  ["Assemble an army and travel to the Eastern Plaguelands. Launch a full assault on Nathanos Blightcaller and any Horde filth that may attempt to protect him.\n\nKeep your wits about you, <name>. The Horde will defend the ranger lord with their very lives."]={0,2813496221},
 }
